import React from "react";
import classes from "./Banner.module.css"
import bannerImage from "../../../assets/Banner/Banner.webp"

const banner = (props) => (
    <>
        <section className={classes.banner_style}>
            <img src={bannerImage} alt="bord de mer, rochers" className={classes.image_style} />
            <h1 className={classes.Title_style}>Chez vous, partout et ailleurs</h1>
        </section>
    </>
);

export default banner;
